import React from "react";
import styled from "styled-components";

const MainImage = styled.div`
  width: 100vw;
  img {
    width: 100%;
    position: relative;
    /* 이미지 위치 조절 */
    top: -40vh;
    filter: brightness(0.7);
  }
`;

const ImageBox = ({ children }) => {
  return <MainImage>{children}</MainImage>;
};

export default ImageBox;
